import React from 'react';
import CharacterCardCreator from './CharcterCardCreator.js';
import { Button, ButtonGroup } from 'reactstrap';
function CharacterCards(props){
    const {data}=props;
    console.log(data)
    const firstC = data[0];
    return(
        <div className="Character-Card">
            <CharacterCardCreator
                image={firstC.image}
                name={firstC.name}
                species={firstC.species}
                gender={firstC.gender}
                location={firstC.location.name}
                origin={firstC.origin.name}>
            </CharacterCardCreator>
            <ButtonGroup>
            <Button>Alive</Button>
            <Button>Dead</Button>
            <Button>Unkown</Button>
            </ButtonGroup>
        </div>
    )
}
export default CharacterCards;
